Licences Identifikators, būdams globāli unikāls identifikators licencei vai līgumam, saskaņā ar kuru preces tiek radītas, iesniegtas apstrādei un/vai apmaksātas, kas tiek veidots, konkatenējot:
 - ISO/IEC 15459 izdošanas aģentūras kodu;
 - licences vai līguma numuru, kas atbilst attiecīgās izdošanas aģentūras prasībām;
 un kas:
 - sastāv tikai no lielajiem alfabēta burtiem un/vai cipariem;
 - ir unikāls (tas ir, atšķiras no jebkura cita ISO/IEC 15459 atbilstoša identifikatora) izdošanas aģentūras domēnā;
 - nevar tikt iegūts no jebkura cita ISO/IEC 15459 atbilstoša identifikatora, kas izdots zem tās pašas izdošanas aģentūras, vienkārši pievienojot rakstzīmes tā beigās vai noņemot tās.

FAO zvejniecības apgabala kods, kā definēts Zivsaimniecības un Akvakultūras departamentā FAO (http://www.fao.org. Meklējiet Zvejniecības Apgabala Kods apakšvietni).
Atļauti visi rakstzīmes no GS1 Vispārīgās Specifikācijas definētā ISO/IEC 646 apakškopas.
Piemēri:
18L37.1.3 Rietumvidusjūra, Sardīnija;
18L47.B.1 Atlantijas okeāns, dienvidaustrumi, SEAFO Divīzija, Namībijas EEZ;
18L67 Klusais okeāns, ziemeļaustrumi.

'26L' Atrašanās Vieta, būdams kods, kas identificē atrašanās vietu vai ģeogrāfisku apgabalu, vai ar šādām atrašanās vietām vai apgabaliem saistītu grupu, kas ir svarīga saistītā darījuma kontekstā un kas atbilst vienai no zemāk definētajām struktūrām:
a) divi lielie alfabēta burti, kas atbilst ISO 3166-1 divu alfabēta burtu valsts kodam valstī, kurā vai no kuras sastāv atrašanās vieta(s) vai apgabals(i);
b) trīs lielie alfabēta burti, kas atbilst IATA lidostas vai pilsētas kodam, kurā, tuvu kurai vai no kuras sastāv atrašanās vieta(s) vai apgabals(i);
c) četri vai vairāk rakstzīmes, no kurām pirmās trīs atbilst ISO 3166-1 valsts kodam, kam seko defiss (-), un atlikušās ir pastkoda attiecīgajā valstī;
d) četri vai vairāk rakstzīmes, no kurām pirmās trīs atbilst ISO 3166-1 valsts kodam, kam seko punkts (.), un atlikušās ir ISO 3166-2 valsts apakšnodalījuma kods attiecīgajā valstī;
e) pieci lielie alfabēta burti, kas atbilst ANO/LOCODE apgabalam, kurā, tuvu kuram vai no kura sastāv atrašanās vieta(s) vai apgabals(i);
f) konkatenācija, kas ir ne mazāk kā septiņi un ne vairāk kā 35 rakstzīmes garš, no:
- ISO/IEC 15459 izdošanas aģentūras koda;
- atrašanās vietas koda, kas sastāv no rakstzīmēm {A-Z; 0-9}, kas atbilst attiecīgās izdošanas aģentūras prasībām.

