Datums, izteikts modificētā UTC atbilstīgā formā:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo], kur kvadrātiekavas norāda uz izvēles iespēju, yyyy ir gads, mmdd ir mēnesis un diena, hhmmss ir dienas laiks stundās, minūtēs un sekundēs, fff ir sekunžu daļas, un poooo ir nobīde no UTC, izteikta stundās un minūtēs, nobīde ir pozitīva, ja p ir punkts (.), un negatīva, ja P ir mīnusa zīme (-).
PIEMĒRS:
2005 - (UTC) kalendārais gads 2005;
200505 - (UTC) kalendārais mēnesis Maijs 2005;
20050518 - (UTC) 18. Maijs 2005;
200505181247 - 12:47 UTC 18. Maijā 2005;
200505181247.0100 - 12:47 vietējais laiks, kas ir 11:47 UTC, 18. Maijā 2005;
20050518124723099 - 99 milisekundes pēc 12:47:23 UTC 18. Maijā 2005.

Kvalificēts Datums, kas sastāv no konkatenācijas:
- ISO/IEC 15459 izdošanas aģentūras kods;
- datuma kvalifikators, kas atbilst šīs izdošanas aģentūras specifikācijām;
- datums, kura formāts un interpretācija atbilst izdošanas aģentūras specifikācijām attiecīgajam datuma kvalifikatoram.

Iepakojuma Materiāla Kategorijas*, Koda* un Svara Deklarācija noteiktam iepakojuma materiālam, kas izmantots noteiktā iepakojumā saskaņā ar ES iepakojuma un iepakojuma atkritumu direktīvu. (Materiāla kategorija un kods definēti Pielikumā M).
12ECCMMMMMMNNNNNUU kur: - '12E' (an3) ir Datu Identifikators;
 - 'CC' (n2) ir Materiāla Kategorija saskaņā ar Pielikumu M;
 - 'MMMMMM' (an1...6) ir Materiāla Kods saskaņā ar Pielikumu M;
 - 'NNNNN' (n5) Materiāla Svars, ieskaitot decimāldaļu punktu (piem., 12.12);
 - 'UU' (an2) ir svara mērvienība (piem., KG, GR, LB vai OZ saskaņā ar ANSI X12.3 kā Pielikumā D).

