Saņēmēja Numurs.
Unikālais identifikācijas numurs var būt IRS, EIN, SSN vai CBP piešķirts numurs, kas nepieciešams Drošības Paziņojumā. Jāizmanto tikai šādi formāti: IRS EIN: NN-NNNNNNN;
IRS EIN ar sufiksu: NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
CBP piešķirts nr.: YYDDPP-NNNNN.
